import './Movie.css';

const Movie = (props) => {
    return (
                <div className="card card-movie">
                    <div className="card-image">
                        <img src="https://m.media-amazon.com/images/M/MV5BMTc5MDE2ODcwNV5BMl5BanBnXkFtZTgwMzI2NzQ2NzM@._V1_SX300.jpg" />
                    </div>
                    <div className="card-content">
                        <span className="card-title">Avengers: Endgame</span>
                        <p>2012</p>
                    </div>
                    <div className="card-action">
                        <a class="waves-effect waves-light btn grey darken-4">more</a>
                    </div>
                </div>
    )
}

export { Movie }
